// # kaiOS ad
document.addEventListener("DOM content loaded", () => {
// For Responsive Ad
 getKaiAd({
        publisher: " 9bf90946-0a73-4cf9-9fb6-ed9aef9e528f",
        appName: "Pokedex",
        slotName: "slot name",

            h: 264,
            w:240,

            container: document.getElementById('ad-container'),
            onerror: err => console.error('custom catch:', err),
            onready: ad => {
              let button = document.getElementById('button')
              button.addEventListener('click', function btnListener() {
                button.removeEventListener('click', btnListener)
                ad.call('display')
              })
              //  user clicked an ad
              ad.call('click',() => console.log('click event'))
              //  user closed an ad
                ad.call('close',() => console.log('close event'))
                // user displayed an ad
                  ad.call('display',() => console.log('display event'))

                  ad.call('display', {
                  tabindex: 0,
                  navclass: 'items',
                  display: 'block',

                  })
              }
      })
  })
